        <Routes>
        <Route path='/' element={<Home></Home>}></Route>
        <Route path="/cart" element={<Cart></Cart>}></Route>
        <Route path='/sam' element={<Sample></Sample>}></Route>
      </Routes>
      </div>
      </Context>
    )

}
export default App;
